import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Image from 'react-bootstrap/Image';
import{Navbar,Nav,Typography} from 'react-bootstrap';
import logo from'./logo/ia.png'
function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
      <main>
        <Container fluid>
            <Row className='bg-light text-dark'>
            <Col>
            <div class="container-fluid">
            <a class="navbar-brand" href="#"></a>
            <img src={logo}
                 width="180" height="90" class="d-inline-block align-text-top"></img> 
            </div>
            </Col>
            <Col xs={9}>
            <div className='text-secondary'
            display={"flex"}
            marginTop={10}>
                  Transcription Tool </div>   
            </Col>
         </Row>
        <Row className="my-4">
        <Col
          color  className="bg-light text-dark"
        >
        </Col>
        </Row>
        </Container>
        </main>
    </div>
  );
}

export default App;
